import { Link } from 'react-router-dom';
import cn from 'classnames';
import styles from './LinkTag.module.css';
import background from '../../images/ym.png'

type Props = {
  className?: string; 
  children?: string | JSX.Element;
  hardware?: "videocards" | "processors" | "cases" | "coolers" | "hdd" | "moutherboards" | "power" | "ram" | "ssd";
  path: string;
}


export default function LinkTag({children, path, hardware, className} : Props) : JSX.Element {
  return (
    <Link  to={path} style={{backgroundImage: `url(${background})`, backgroundRepeat:"no-repeat", backgroundSize:"contain", height: 60, width: 60}} className={cn(className, styles.btn)} state={hardware}>{children}</Link>
  )
}
